import logo from './logo.svg';
import './App.css';
import p from '../images/s.png';
function App() {
  return (
    <div className="App">
      <nav class="navbar bg-body-tertiary">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">
            <img src={p} alt="Logo" width="30" height="24" class="d-inline-block align-text-top"/>
            Bootstrap
          </a>
        </div>
      </nav>
    </div>
  );
}

export default App;
